import React from 'react'
import styled from 'styled-components';

function TimePicker() {

    let minute = [...Array(60)].map((v,i) => i);

    console.log( minute);

    return (
        <div>
            <div className="TimePicker-hour">
                {[...Array(12)].map((v,i) => 
                    <option value={i}>{i}</option>)}
            </div>

            <div className="TimePicker-minute">
                {minute}
            </div>

        </div>
    )
}

export default TimePicker
